input = ""
function reduce(str)
    local ostr = str
    local r = true
    while r do
        local i = 1
        r = false
        while (i < #ostr) do
            local s1 = ostr:sub(i, i)
            local s2 = ostr:sub(i + 1, i + 1)
            if s1 ~= s2 and s1:lower() == s2:lower() then
                ostr = ostr:sub(1, i - 1) .. ostr:sub(i + 2)
                r = true
            else
                i = i + 1
            end
        end
    end
    return ostr
end
output = reduce(input)
--part 1
print("answer 1:" .. #output)
